import React, { Component } from 'react';

class Innercomponenet extends Component {
    state = {
        BMW: ["BMW model 1", "BMW model 2", "BMW model 3"],
        Lamborghini : ["lambo model 1", "lambo model 2", "lambo model 3"],
        other : ["model 1", "model 2", "model 3"],
    };
    selectvalue = (comingvalue)=>{
        const {BMW, Lamborghini,other}=this.state;
        if(comingvalue === "BMW"){
            return BMW.map((coup,index) => { return <div key={`${index}_fil1`}><div className="card"> <div className="card-body"> <p> {coup} </p></div> </div>  </div> });
        }
        else if(comingvalue === "Lamborghini"){
            return Lamborghini.map((car,index) => { return <div key={`${index}_fil2`}><div className="card"> <div className="card-body"> <p> {car} </p></div> </div> </div> });
        }
        else {
            return other.map((oth,index) => { return <div key={`${index}_fil3`}><div className="card"> <div className="card-body"> <p>{comingvalue +" "+ oth} </p></div> </div></div> });
        }
    }
    render()
    {
        const comingvalue = this.props.selectedvalue;
        return(<div>
                        {this.props.selectedvalue}
                        {this.selectvalue(comingvalue)}
                </div>);
    }
}
export default Innercomponenet
